(def Div "Div[{f1, …, fn}, {x1, …, xn}] gives the divergence ∂f1/∂x1+…+∂fn/∂xn.\nDiv[{f1, …, fn}, {x1, …, xn}, chart] gives the divergence in the coordinates chart." (wolframite.impl.wolfram-syms.intern/wolfram-fn (quote Div)))
