(def OrthogonalMatrixQ "OrthogonalMatrixQ[m] gives True if m is an explicitly orthogonal matrix, and False otherwise." (wolframite.impl.wolfram-syms.intern/wolfram-fn (quote OrthogonalMatrixQ)))
